/*create array:*/
var marker = new Array();
// var farmnum; 

function buildMap() {


//create empty array to push into
    var raw = [];

//create array of values
    var iconvalue = [];


//for each point, push if it is the right type and if that has been clicked
    for (var i = 0; i < geoJson[0].features.length; i++) {
      if (geoJson[0].features[i].properties.end_year >= cur_year) {
        if (geoJson[0].features[i].properties.OPERATING_YEAR <= cur_year) {
            raw.push(geoJson[0].features[i])
            //iconvalue.push(geoJson[0].features[i].infomation);
            //console.log(geoJson[0].features[i].properties.OPERATING_YEAR)
        } 
      }
    };

    // farmnum = raw.length;

    for (var i = 0; i < raw.length; i++) {
     //create a the "iconic" url for the icon, from the mapbox api.
    
     //console.log(raw[i].properties.cum_cap)
     //cap = cap + raw[i].properties.cum_cap;
     //console.log(cap)
      var iconic

//can set iconic = to something here.

 if (raw[i].properties.OPERATING_YEAR === cur_year) {
        iconic = 'https://energy.gov/sites/prod/files/point.png'
    } else if (raw[i].properties.OPERATING_YEAR >= 2010 ) {iconic = 'https://energy.gov/sites/prod/files/recent.png'}
      else if (raw[i].properties.OPERATING_YEAR >= 2000 ) {iconic = 'https://energy.gov/sites/prod/files/00s.png'}
      else if (raw[i].properties.OPERATING_YEAR >= 1990 ) {iconic = 'https://energy.gov/sites/prod/files/90s.png'}
      else if (raw[i].properties.OPERATING_YEAR >= 1970 ) {iconic = 'https://energy.gov/sites/prod/files/80s.png'}


      // Create custom popup content
       
      /*pushing items into array each by each and then add markers*/
      var LamMarker = new L.marker([raw[i].geometry.coordinates[1],raw[i].geometry.coordinates[0]], {
        icon: L.icon({
            iconUrl: iconic,
            iconSize:     [9, 9], // size of the icon
            iconAnchor:   [4, 4], // point of the icon which will correspond to marker's location
            popupAnchor:  [1, -23]  // point from which the popup should open relative to the iconAnchor
            })
        });
          marker.push(LamMarker);
          map.addLayer(marker[i]);

    };


};

function removal() {
    for (var i = 0; i < marker.length; i++) {
        map.removeLayer(marker[i]);
    };
    marker = [];
};

handle = document.getElementById('handle');
startlight = document.getElementById('startlight');
yearnumber = document.getElementById('year');
farms2number = document.getElementById('farms');
homes2number = document.getElementById('homes');



start_year = 1983;
cur_year = 2013;
num = cur_year - start_year + 1;
// console.log()
var takex;
var play, slowplay = 0;
var x;
var h;
var homenum = ["0","3470","11 K","28 K","37 K","55 K","78 K","101 K","101 K","101 K","101 K","101 K","101 K","101 K","101 K","101 K","101 K","101 K","102 K","103 K","103 K","103 K","103 K","103 K","130 K","139 K","166 K","226 K","412 K","807 K","1.7 M"];
var farmnum = ["0","1","2","4","5","8","9","10","10","10","10","10","10","10","10","10","10","10","13","14","15","15","16","18","32","52","81","139","282","479","682"];

var zoom_bar = new Dragdealer('zoom-bar',
{
    steps: num,
    snap: true,
    x: 1,
    animationCallback: function(x, y)
    {
        cur_year = start_year+(x*(num-1))
        handle.innerHTML = cur_year;
        takex = x;
        removal();
        h = x*(num-1);
        // console.log(h)
        buildMap();             
        farms.innerHTML = farmnum[h];
        homes.innerHTML = homenum[h];
        yearnumber.innerHTML = cur_year;
        farms2number.innerHTML = farmnum[h];
        homes2number.innerHTML = homenum[h];
        
    }
});

//step through the years one by one.
var i = -8;
var j = 0;
var k = 0;

function mechanic() {
        i += 1;             
        //console.log(i+start_year-1)
        //console.log(cur_year);
        zoom_bar.setValue(i / num);
        if (i === num) {
            clearInterval(play);
            clearInterval(slowplay);
            j = 0;
            k = 0;
        };
}

function start() {
play = setInterval(mechanic,200);
}

function slowstart() {
slowplay = setInterval(mechanic,1000);
}

//Use buttn to move the scroll bar.
startlight.onclick=function(){
    clearInterval(slowplay);
    
    //after run all the way through, reset to beginning
    if (i === num) {i = -7};
    
    k = 0;
    j += 1;
    if (j === 1) {start();};
    
};

yellowlight.onclick=function(){
    clearInterval(play);

    //after run all the way through, reset to beginning
    if (i === num) {i = -2};
   
    j = 0;
    k += 1;
    if (k === 1) {slowstart();};

}   

stoplight.onclick=function(){
    clearInterval(play);
    clearInterval(slowplay);
    
    //reset to zero so that on play click, will start again.
    j = 0;
    k = 0;
};



